        ]
    },
    {
        name: 'Организации',
        icon: <i className="feather-command" />,
        status: false,
        url: "/admin/organizations",
        children: []
    },
    {
        name: 'Выход',
        icon: <i className="feather-lock" />,
        status: false,
        url: "/admin/log-out",
        children: []
    },
]
